import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("./Rule JSON.json")
      .then((response) => response.json())
      .then((item) => setData(item.data));
  }, []);

  console.log(data);

  return (
    <div>
      {data.map((entry, index) => {
        return (
          <>
            <p>{entry.id}</p>
          </>
        );
      })}
    </div>
  );
}

export default App;

